INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (221,'065','많은 꿀이 땅으로 날라 다니니 큰 매가 날개를 펴쳐 든쳐오는 격입니다. 때를 잃고 활동하니 하는 일에 협력함이 있겠습니다. 하는 일에 조급함을 앞세워 먼길되이 행동하면 안되겠습니다. 근심이 생기고 기쁨이 흐려지겠습니다. 그러나 공고함을 한탄하지 말고 참고 갈대면 초월은 곤하나 뒤에는 길하겠습니다. 불리한 운수임에도 불구하고 일을 바이는 것은 좋지 않습니다. 성공함은 재물을 몽하고 오기 때문입니다. 또한 다른 사람을 함부로 믿지 말고 신중을 기하십시오. 겉으로는 친절을 가장하지만 속마음은 악이 가득합니다. 그러나 선조가 기쁨을 가져다주니 금년의 후반기에는 근심이 도리어 기쁘지고 재물이 왕성해지며 후운가 있을 운수입니다. 초월과 중반운은 다소 불리하더라도 신념을 가지고 이겨나가면 반드시 복운이 트이겠습니다.','산에 들어가 고기를 구하려 하니 하는 일에 협력함만 남겠습니다. 마음에 정한 곳이 없어 동으로 달고서 서쪽으로 푸는 격입니다. 사업을 새로 바였으나 매사 여의챦 못해 끝을 이루고 성과를 얻지 못하는 불리한 운세입니다.','마루나무가 가을을 만나니 그 항후하고 찬란한 모습을 누가 알겠습니까. 불리한 운수 속에 가정은 점점 불안해지가고 설상가상으로 질병이 생겨날 운수입니다. 몸과 마음 모두가 흔들지 않는 일 속에서 무로움만 하니다. 정성으로 기도하면 이 운에서 빠져나갈 것입니다.','근심이 꿈치지 않으니 바람을 이루지 못하겠습니다. 집에는 질고가 있어 마음이 편안하지 못하겠습니다. 마음을 달래려고 집을 떠나 밖으로 나가려하면 또 다른 운물이 도사리고 있게될 운입니다. 밖에는 이익 될 일이 없으니 집을 지키며 인내하는 것이 좋겠습니다.','우연히 시작한 일에 재물이 들어올니다. 물에서 이익을 찾으려 하면 흉함상이고 잘지에서 복록을 구하면 꿋꿋한 대로 이루어지겠습니다. 그러나 바라던 일을 이루려 해도 들어온 이익이 모자라는 감이 있겠습니다.','다 되어 가던 일에 차질이 오니 마치 밝은 달을 뜻밖의 구름이 가리는 격입니다. 비리의 재물을 조심하십시오. 이를 탐하게 되면 운물이 닥치겠습니다. 경영하던 일에 액운이 닥치니 반드시 흉함이 있겠습니다. 잘 된 것이 약간 실패수가 따르겠습니다. 가는 길에 재물을 잃는 불운이 따르겠습니다.','암에 찾아가 정성을 드려 기도하십시오. 만약 그렇지 않으면 집안에 질병으로 고통이 닥치겠습니다. 이생와 박생 성을 가까이 하면 반드시 재물을 얻게 됩니다. 관기가 발동하니 먼 곳으로 떠나지 않는 게 좋습니다. 가는 길에 재물을 잃는 불운이 따르겠습니다.','축은한 닭새가 서리를 만날과 같으니 몸과 마음이 편치를 않겠습니다. 하던 일은 역매가 없는 꿋과 같아 얻으려 해도 기쁨이 생기지 않겠습니다. 먼 곳으로 가는 것은 불리합니다. 분수를 지키며 심신을 정리함이 좋겠습니다. 모든 것이 마음에 있음을 알아야 합니다.','일에 서두가 없으니 결과를 구하나 이루지 못하겠습니다. 그렇다고 새로운 일을 꿋꿋하려 하면 하던 일만 못하겠습니다. 꾸준하게 한쪽으로 하여 좋은 결과를 기대함이 좋겠습니다. 그러나 시작에 비해 얻어지는 결과는 기대보다 적겠습니다.','큰 뜻을 품었으나 결과는 보잘것없으니 밭을 그리려다 개를 그려놓은 격이겠습니다. 북방으로 오는 소는 우연히 해를 낳치겠습니다. 그러나 새로운 사업을 시작하게 되면 재물이 희망하니 한 번쯤 마음의 기회를 펴볼직 하겠습니다.','해가 서산에 지는데 돌아가는 길에 길을 잃는 격이니 심신을 가늠할 기력이 없겠습니다. 경영하던 일은 하나도 이루어지지 않겠고 운물이 있어 만일 손재가 아니면 화를 당할 운입니다.','공고하던 시절이 가고 길운이 돌아오니 반드시 운복이 있겠습니다. 음과 양이 서로 조합하여 아무리 어려운 일이 닥쳐도 무사히 헤쳐나가겠습니다. 재물이 왕성하여 근심걱정이 사라지고 반드시 후운할 운이겠습니다. 힘껏 목적을 향해 달려나가십시오.','남을 믿지 마십시오. 남 믿을 생각하여 타인을 믿고 사귀면 도리어 큰 해를 입겠습니다. 백가지 일에 마가 따르므로 마음은 있어 노력하고 이루려고 하나 수고한 만큼의 공이 없겠습니다. 집에 있으면 길하고 멀리 나가면 해가 있겠습니다.','2025-03-02 12:02:33.536145+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (434,'065','许多蜂蜜正在飞到地上，翅膀上有一个大鹰。失去时间的工作将有一项合作。我不应该在工作面前做很长的路要走。我们会担心的，喜悦会变得模糊。但是，不要为通知而感到遗憾，但是如果您将其掩盖，那么超越就很难，但它会落后。尽管不利，但工作不好。这是因为成功即将来临。另外，不要相信别人，要小心。在外面，它们很友善，但是内心充满了邪恶。但是，祖先带来了欢乐，因此在今年下半年，焦虑很高兴，财富很猛烈，会有飓风。即使超越性和中低落有些不利，如果您克服了自己的信念，那么您肯定会很幸运。','我要去山去寻找肉。没有地方可以决定，因此您可以向西方解决它。这是一项新业务，这是一项不利的财富，但它并不是任何地方的尽头，也没有取得成果。','谁知道Maruna树遇到了秋天，这是反对的，而且外观的外观很棒？在不利的运输中，家庭变得越来越不稳定，为了使疾病成为一种疾病，这将是一种运输。这只会使身心都不动的事情无动于衷。如果您真诚地祈祷，您将摆脱这一运气。','我不必担心，所以我无法实现风。家里有韧性，所以我感到不舒服。如果您离开房子，出去舒缓您的想法，另一个水潜伏。外部没有任何好处，因此最好保留您的房屋。','财富偶然发生了。如果您尝试在水中找到利润，那将是丑陋的。但是，即使您尝试实现自己想要的东西，也可能缺乏利润。','这是对工作的破坏，明亮的月亮是出乎意料的。提防腐败的财富。如果您渴望它，您将来到水中。工作的运气不好。好事将有点失败。在途中，我将遵循失去财富的厄运。','去癌症祈祷。否则，我会在屋子里患有一种疾病。如果您结束了这一生，并将Saeng Castle停放，那么您一定会获得财富。最好不要离开一个遥远的地方，因为政府被激活。在途中，我将遵循失去财富的厄运。','轴就像是鸡鸟遇到霜，所以我对自己的身心不满意。我所做的不像肝脏，但我不会感到快乐。去遥远的地方是不利的。保持喷泉并组织身心是一件好事。您必须知道一切都在您心中。','没有急于工作，所以我无法取得结果。但是，如果您尝试做新事情，我不能做到。很好地期望一方面良好的结果。但是与开始相比，结果少于预期。','它具有很大的含义，但是结果不好，所以我会画一只狗来画一个领域。来到北部的奶牛会偶然发生。但是，当我们开始一家新业务时，我们希望财富充满希望。','塞桑（Seosan）浪费了太阳，因此在返回的路上丢失了。将没有工作，也没有水，因此，如果您不是敏捷，您会生气的。','当宣布的日子走了，道路回来时，一定有一件制服。阴和数量相互结合，无论发生多么困难，我们都会安全地进行。财富是如此强大，以至于忧虑消失了，我一定会很幸运。为了您的目的而运行。','不要相信别人。如果您相信别人并相信他人，您将非常有害。这是一百件事，所以我有一颗心，所以我会尝试实现它，但是我没有努力工作的那么多。如果您在家，它将很长，您将是有害的。','2025-03-02 12:02:33.536145+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (505,'065','たくさんの蜂蜜が地面に飛んでおり、大きな鷹が翼にあります。時間を失う仕事には協力があります。私は自分の仕事の前で長い道のりを歩むべきではありません。私たちは心配し、喜びはぼやけます。ただし、通知を嘆かないでください。しかし、もしあなたがそれをリードするなら、超越は難しいですが、それは長く遅れています。不利であるにもかかわらず、仕事は良くありません。これは、成功が繰り返されているからです。また、他の人を信じないでください。外側では、彼らは親切ですが、内なる心は悪に満ちています。しかし、先祖は喜びをもたらしたので、今年の後半には不安が喜んでおり、富は活発であり、ハリケーンがあります。超越と中ラックがやや不利であっても、信念を克服すれば、確かに運がよければ。','私は山に行き、肉を探します。決定される場所はないので、西に解決できる場合です。それは新しいビジネスであった不利な財産ですが、それはどこでも終わりではなく、結果を達成していません。','マルナの木が秋に出会うことを誰が知っていますか？不利な輸送では、家族はますます不安定になり、病気を作るためには、それが発生する輸送です。体と心の両方が揺れていないことは無関心です。あなたが誠実に祈るなら、あなたはこの運から抜け出すでしょう。','心配する必要はないので、風を達成できません。家にはタフネスがあるので、私は快適に感じることができません。あなたが家を出て、あなたの心を落ち着かせるために出かけると、別の水が潜んでいます。外部から利益を得るものは何もないので、あなたの家を維持する方が良いです。','富は偶然に起こったことに来ます。水中で利益を見つけようとすると、醜いでしょう。しかし、あなたが望むことを達成しようとしたとしても、あなたは利益が不足しているかもしれません。','それは仕事の混乱であり、明るい月は予想外です。腐敗の豊富なことに気をつけてください。あなたがそれを切望しているなら、あなたは水に来るでしょう。仕事には不運があります。良いことはちょっとした失敗です。途中で、私は富を失う不運に従います。','癌に行き、ケアを祈ります。そうでなければ、私は家の中で病気に苦しむでしょう。この命を閉じて駐車した城を駐車すると、きっと富を得るでしょう。政府が活性化されているため、遠い場所に出発しない方が良いです。途中で、私は富を失う不運に従います。','軸は鶏の鳥が霜に出会うようなものなので、私は自分の体と心に満足していません。私がしたことは肝臓のようではありませんが、私は喜びに満ちていません。遠い場所に行くのは不利です。噴水を維持し、心と体を整理するのは良いことです。あなたはすべてがあなたの心の中にあることを知っている必要があります。','急いで仕事をすることはないので、結果を達成できません。しかし、あなたが新しいことをしようとするなら、私はそれをすることはできません。良い結果を片側に期待するのは良いことです。しかし、結果は最初と比較して予想よりも少ないです。','それは素晴らしい意味を持っていますが、結果は良くないので、私は犬を描いてフィールドを描きます。北に来る牛は偶然に起こります。しかし、新しいビジネスを始めるとき、私たちは富が希望に満ちていることを願っています。','太陽はソーサンで失われるので、帰り道で失われます。仕事がなく、水がないので、あなたが器用さでなければ、あなたは怒っているでしょう。','発表の日が過ぎて道路が戻ってきたとき、制服がなければなりません。陰と量は互いに組み合わされています。それがどんなに困難になっても、私たちは安全に通過します。富は非常に強いので心配が消えてしまいます。私は確かに幸運です。あなたの目的のために走ってください。','他人を信じないでください。あなたが他の人を信じて他の人を信じるなら、あなたは非常に有害になります。それは百のことなので、私は心を持っているので、私はそれを試して達成しますが、私は一生懸命働いたほど持っていません。あなたが家にいるなら、それは長くなり、あなたは有害になります。','2025-03-02 12:02:33.536145+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (363,'065','A lot of honey is flying to the ground, and a big hawk is on the wings. There will be a cooperation in the work of losing the time. I shouldn''t act a long way in front of my work. We will be worried and joy will be blurred. However, don''t lament the notification, but if you reed it, transcendence is hard, but it will be long behind. Despite being unfavorable, it is not good to work. This is because success is coming and coming. Also, do not believe others and be careful. On the outside, they are kind, but the inner heart is full of evil. However, the ancestors brought joy, so in the second half of this year, the anxiety is pleased, the riches are vigorous, and there will be a hurricane. Even if the transcendence and mid -luck are somewhat disadvantageous, if you overcome with your beliefs, you will surely be luck.','I''m going to go to the mountain and seek meat. There is no place to be decided, so it is a case where you can solve it to the west. It is a disadvantageous fortune that has been a new business, but it is not the end of everywhere and does not achieve results.','Who knows that the Maruna Tree meets autumn, and that''s the anti -and brilliant look? In the unfavorable transportation, the family becomes increasingly unstable and in order to make a disease, it is a transportation that will occur. It is only indifferent in things that both body and mind are not shaking. If you pray with sincerity, you will get out of this luck.','I don''t have to worry, so I can''t achieve the wind. There is a toughness at home, so I can''t feel comfortable. If you leave the house and go out to soothe your mind, another water will be lurking. There is nothing to benefit from outside, so it is better to keep your home.','Riches come to what happened by chance. If you try to find profits in the water, it will be ugly. But even if you try to achieve what you want, you may have a lack of profit.','It is a disruption to the work, and the bright moon is unexpected. Watch out for the wealth of corruption. If you covet it, you will come to the water. There is a bad luck in the work. The good thing will be a bit of a failure. On the way, I will follow the bad luck that loses wealth.','Go to the cancer and pray for care. Otherwise, I will suffer from a disease in the house. If you close this life and Park Saeng Castle, you will surely get wealth. It is better not to leave for a distant place because the government is activated. On the way, I will follow the bad luck that loses wealth.','The axis is like a chicken bird meets frost, so I will not be comfortable with my body and mind. What I did is not like a liver, but I will not be joyful. Going to a distant place is disadvantageous. It is good to keep the fountain and organize the mind and body. You must know that everything is in your heart.','There is no rush to work, so I can''t achieve the results. But if you try to do new things, I can''t just do it. It is good to expect good results to one side. But the results are less than expected compared to the beginning.','It has a great meaning, but the result is not good, so I will draw a dog to draw a field. The cows coming to the north will happen by chance. However, when we start a new business, we hope that wealth is hopeful.','The sun is lost in Seosan, so it''s lost on the way back. There will be no work, and there are no water, so if you are not a dexterity, you will be angry.','When the days of the announcement went and the road came back, there must be a uniform. The yin and the amount are combined with each other, no matter how difficult it happens, we will go through safely. The riches are so strong that the worries disappear, and I will surely be lucky. Run for your purpose.','Do not believe in others. If you believe in others and believe in others, you will be greatly harmful. It''s a hundred things, so I have a heart, so I will try and achieve it, but I don''t have as much as I worked hard. If you are at home, it will be long and you will be harmful.','2025-03-02 12:02:33.536145+00','e');
